import {
  View,
  Text,
  BackHandler,
  TextInput,
  ToastAndroid,
  Image,
} from 'react-native';
import Header from '../../../components/GradientHeader';
// import {TextInput} from 'react-native-paper';
import {
  heightPercentageToDP as hp,
  widthPercentageToDP as wp,
} from 'react-native-responsive-screen';

import FontAwesomeIcon from 'react-native-vector-icons/FontAwesome';
import {ScrollView, FlatList} from 'react-native-gesture-handler';
import Carousel from 'react-native-snap-carousel';

const LandscapeImages = [
  {
    key: Math.random().toString(),
    image: 'https://unsplash.com/photos/twukN12EN7c/download',
  },
  {
    key: Math.random().toString(),
    image: 'https://i.ytimg.com/vi/c7oV1T2j5mc/maxresdefault.jpg',
  },
  {
    key: Math.random().toString(),
    image:
      'data:image/jpeg;base64,',
  },
  {
    key: Math.random().toString(),
    image:
      'https://img1.goodfon.com/wallpaper/nbig/7/5d/patagonia-landscape-panoramic.jpg',
  },
  {
    key: Math.random().toString(),
    image:
      'data:image/jpeg;base64,',
  },
  {
    key: Math.random().toString(),
    image:
      'data:image/jpeg;base64,',
  },
  {
    key: Math.random().toString(),
    image: 'https://i.vimeocdn.com/video/703876203_640.jpg',
  },
];

class Home extends Component {
  constructor(props) {
    super(props);
    this.flatList = createRef();
    this.onViewableItemsChanged.bind(this);
    this.handleBackButtonClick = this.handleBackButtonClick.bind(this);
    this.state = {
      currentSlide: 0,
    };
  }

  onViewableItemsChanged = ({viewableItems, changed}) => {
    this.setState({currentSlide: viewableItems[0].index + 1});
  };

  componentWillMount() {
    BackHandler.addEventListener(
      'hardwareBackPress',
      this.handleBackButtonClick,
    );
  }

  componentWillUnmount() {
    BackHandler.removeEventListener(
      'hardwareBackPress',
      this.handleBackButtonClick,
    );
  }

  handleBackButtonClick() {
    BackHandler.exitApp();
    return true;
  }

  componentDidMount() {
    this.startScrolling();
    console.log('Home');
  }

  startScrolling = () => {};

  render() {
    return (
      <View>
        <Header {...this.props}></Header>
        <View
          style={{
            marginBottom: hp('2%'),
            flexDirection: 'row',
            borderWidth: 1,
            borderColor: '#ccc',
            elevation: 1,
            justifyContent: 'flex-start',
            alignItems: 'center',
            borderRadius: hp('0.5%'),
            marginHorizontal: hp('2.5%'),
            marginTop: hp('2%'),
          }}>
          <TextInput
            style={{flex: 1, fontSize: hp('1.8%'), marginLeft: hp('1.5%')}}
            placeholder="search"></TextInput>
          <FontAwesomeIcon
            onPress={() => {
              ToastAndroid.show('Searching', ToastAndroid.SHORT);
            }}
            style={{marginRight: hp('2%')}}
            name="search"
            size={hp('2.5%')}
            color="darkgrey"></FontAwesomeIcon>
        </View>

        <View style={{justifyContent: 'center', alignItems: 'center'}}>
          <FlatList
            ref={this.flatList}
            pagingEnabled={true}
            onViewableItemsChanged={this.onViewableItemsChanged}
            style={{height: 150, width: 250}}
            horizontal={true}
            data={LandscapeImages}
            renderItem={({item, index}) => (
              <View>
                <Image
                  style={{height: 150, width: 250, resizeMode: 'cover'}}
                  source={{
                    uri: item.image,
                  }}></Image>
              </View>
            )}></FlatList>
          <View
            style={{
              marginTop: 20,
              justifyContent: 'center',
              alignItems: 'center',
              flexDirection: 'row',
            }}>
            {LandscapeImages.map((item, index) => (
              <View
                style={{
                  marginHorizontal: 5,
                  height: 10,
                  width: 10,
                  backgroundColor:
                    this.state.currentSlide == index + 1 ? 'orange' : '#ccc',
                  borderRadius: 5,
                }}></View>
            ))}
          </View>
        </View>
      </View>
    );
  }
}

export default Home;
